import {SEARCH_BY_NAME,SEARCH_BY_NAME_SUCCESS,SEARCH_BY_NAME_FAIL} from "../constants/search";


const initialState = {
    product: false,
    error: false,
    loading: false,
}

const reducerProduct = (state=initialState, action)=>{
    switch (action.type) {
        case "SEBA":
            break;
        default:
            return state
    }
}
export default reducerProduct;
